import React from 'react'
import { ScrollingCarousel } from '@trendyol-js/react-carousel'

export interface Tag {
  text: string
  img: string
  id: string
}

const slideData: Tag[] = [
  {
    text: 'N5',
    img: 'data:image/webp;base64,',
    id: 'N5'
  },
  {
    text: 'N4',
    img: 'data:image/webp;base64,',
    id: 'N4'
  },
  {
    text: 'N3',
    img: 'data:image/jpeg;base64,',
    id: 'N3'
  },
  {
    text: 'N2',
    img: 'data:image/png;base64,',
    id: 'N2'
  },
  {
    text: 'N1',
    img: 'data:image/png;base64,',
    id: 'N1'
  },
  {
    text: 'Favorite decks',
    img: 'data:image/jpeg;base64,',
    id: 'FAVORITE'
  },
  {
    text: 'Custom Decks',
    img: 'data:image/png;base64,',
    id: 'CUSTOM'
  }
]

function TagList (): JSX.Element {
  const handleClick = (id: string): void => {
    console.log('TAG SELECTED', id, `navigate to /study/tag/${id}`)
  }

  return (
    <ScrollingCarousel className="scrolling-carousel-example1">
      {
        slideData.map((d: Tag, i: number) =>
          <div key={d.id}
            onClick={() => { handleClick(d.id) }}
            style={{
              cursor: 'pointer',
              display: 'flex',
              border: '1px solid #DFE1E5',
              borderRadius: '20px',
              height: '40px',
              lineHeight: '38px',
              paddingRight: '12px',
              margin: '14px 8px 14px 0'
            }}>
            <img style={{
              borderRadius: '16px',
              height: '32px',
              marginBottom: '3px',
              marginLeft: '3px',
              marginRight: '8px',
              marginTop: '3px',
              width: '32px'
            }}
            src={d.img}/>
            <span style={{ fontSize: '12px' }}>
              {d.text}
            </span>
          </div>
        )
      }
    </ScrollingCarousel>
  )
}

export default TagList
